import logo200Image from 'assets/img/logo/logo_200.png';
import React from 'react';
import { Button,   Card,
  CardBody,
  CardImg,
  CardImgOverlay,
  CardLink,
  CardText,
  CardTitle,
  Col,
  Row, } from 'reactstrap';
import { withRouter, Link } from "react-router-dom";

class BlankPage extends React.Component {
  constructor() {
    super()
    this.state = {
      modal: true,
      modal_backdrop: false,
      modal_nested_parent: false,
      modal_nested: false,
      backdrop: true,
    }

  }
 
  render() {


    return (
     <Row allowFullScreen>
           <Card style={{ height: 800,width:600 ,marginLeft:300}}>
              <CardBody>
                <CardTitle>Votre demande d'adh√©sion est en cours de traitement</CardTitle>
                <CardText>
                  <Link to="/login">
                  <Button>Reconnectez Vous </Button></Link>
              </CardText>
              </CardBody>
            </Card>
     </Row>
    );
  }
}



export default withRouter(BlankPage);
